import React from "react";
import { useSelector } from "react-redux";

const Mainpage = () => {
  let state = useSelector((state) => {
    return state;
  });
  return (
    <div>
      <p>main page</p>
      <p>{state.memberReducer[0]}</p>
    </div>
  );
};

export default Mainpage;
